import React, { Component } from 'react';
import { connect } from 'react-redux';
import { foodIngredient } from '../redux/actions/foodActions';
import Header from '../components/Header';
import Footer from '../components/Footer';

class ExploreFoodIngredients extends Component {
  constructor() {
    super();

    this.renderFoodIngredients = this.renderFoodIngredients.bind(this);
  }

  async renderFoodIngredients() {
    const { fetchFoodIngredient } = this.props;
    const resolveFoodIngredient = await fetchFoodIngredient();
    console.log(resolveFoodIngredient);
  }

  render() {
    return (
      <div>
        <Header />
        <button
          type="button"
          onClick={ this.renderFoodIngredients }
        >
          fetchIngredient
        </button>
        <Footer />
      </div>
    );
  }
}

const mapDispatchToProps = (dispatch) => ({
  fetchFoodIngredient: () => dispatch(foodIngredient()),
});

export default connect(null, mapDispatchToProps)(ExploreFoodIngredients);
